import React from 'react'
// import {imageUrl } from '../../../utils/common/common'
// import './Hero.css'

function Hero(props) {
  return (
    <figure className='hero-wrapper'>
      <span className='show-container hero-cover show'>
        <img className='reveal img-reveal' src={props.data.image} alt=""/>
        <div className="runner"></div>
      </span>
      <style jsx>{`
        .hero - wrapper {
            width: 250 px;
            height: 250 px;
            position: absolute;
            top: calc(100 vh - 65 vh);
            left: calc(100 % -40 % )
          }

          .hero - cover {
            display: inline - block;
            position: relative;
            width: 100 % ;
            height: 100 % ;
            overflow: hidden;
          }

          .img - reveal {
            display: block;
            width: 100 % ;
            height: 100 % ;
          }



        @media(max - width: 1468 px) {
          .hero - wrapper {
            width: 235 px;
            height: 235 px;
            top: calc(100 vh - 67 vh);
            left: calc(100 % -40 % )
          }
        }

        @media(max - width: 1368 px) {
          .hero - wrapper {
            width: 230 px;
            height: 230 px;
            left: calc(100 % -38 % );
          }
        }

        @media(max - width: 1268 px) {
          .hero - wrapper {
            width: 225 px;
            height: 225 px;
            left: calc(100 % -40 % );
          }
        }

        @media(max - width: 1168 px) {
          .hero - wrapper {
            width: 220 px;
            height: 220 px;
            left: calc(100 % -42 % );
          }
        }

        @media(max - width: 1068 px) {
          .hero - wrapper {
            width: 210 px;
            height: 210 px;
            left: calc(100 % -44 % );
          }
        }
        @media screen and(max - width: 1070 px) and(orientation: landscape) {
          .hero - wrapper {
            top: calc(100 vh - 74 vh);
          }
        }

        @media(max - width: 968 px) {
          .hero - wrapper {
            width: 210 px;
            height: 210 px;
            top: calc(100 vh - 67 vh);
          }
        }


        @media(max - width: 868 px) {
          .hero - wrapper {
            width: 200 px;
            height: 200 px;
            left: calc(100 % -46 % );
          }
        }

        @media(max - width: 768 px) {
          .hero - wrapper {
            width: 190 px;
            height: 190 px;
          }
        }


        @media(max - width: 668 px) {
          .hero - wrapper {
            width: 180 px;
            height: 180 px;
            left: calc(100 % -48 % );
          }
        }

        @media(max - width: 568 px) {
          .hero - wrapper {
            left: calc(100 % -67 % );
          }
        }

        @media(max - width: 468 px) {
          .hero - wrapper {
            top: calc(100 vh - 79 vh);
            left: calc(100 % -72 % );
          }
        }

        @media(max - width: 368 px) {
          .hero - wrapper {
            left: calc(100 % -76 % );
            top: calc(100 vh - 80 vh);

          }
        }
      `}</style>
    </figure>
  )
}

export default Hero
